import React from "react";
import HeroSectionSimple from "../Components/HeroSectionSimple";
import rocketback from "../Images/rocket-back.jpg";
import RocketCard from "../Components/RocketCard";

export default function RocketsPage() {
  return (
    <div>
      <HeroSectionSimple cover={rocketback} title="Rockets" />
      <RocketCard
        title=""
        desc=" With the ability to lift into orbit over 54 metric tons (119,000
                lb)--a mass equivalent to a 737 jetliner loaded with passengers,
                crew, luggage and fuel--Falcon Heavy can lift more than t`wice
                the payload of the next closest operational vehicle, the Delta
                IV Heavy, at one-third the cost."
      />
      <RocketCard />
      <RocketCard />
      <RocketCard />
      <RocketCard />
    </div>
  );
}
